import{_ as i}from"./plugin-vue_export-helper-c27b6911.js";import{r as o,o as s,c as n,b as a,d as e,a as d,f as r}from"./app-d028e69d.js";const p={},c=r('<h2 id="背景" tabindex="-1"><a class="header-anchor" href="#背景" aria-hidden="true">#</a> 背景</h2><p>当你拿到一个项目时，这个项目可能跟你想象得不一样，它跟你平时写的项目不一致。这时，你需要先确定是先项目是什么项目、使用的环境是怎么的？可能你会遇到这样那样的问题，在同一台服务器上有多人共同使用，遇到权限问题、安装软件重启服务器问题、配置不生效问题等。</p><h2 id="开发工具的选择" tabindex="-1"><a class="header-anchor" href="#开发工具的选择" aria-hidden="true">#</a> 开发工具的选择</h2><p>是选择使用eclipse还是idea，根据自己的使用习惯。</p><p>环境：<br> 可能拿到一个项目，无法直接确定项目中使用的jdk版本、缺失的依赖等。</p><p>这里以idea为例</p><h2 id="环境配置" tabindex="-1"><a class="header-anchor" href="#环境配置" aria-hidden="true">#</a> 环境配置</h2><p>开发环境：windows Server 2008 R2 Enterprise 64为操作系统</p><p>sbf项目</p><p>jdk1.8</p><p>idea2022.02.02、tomcat8.5</p><p>svn1.14.5.29465-x64</p><blockquote><p>对应需要安装vc_redist.x64.exe环境</p></blockquote><h2 id="导入项目" tabindex="-1"><a class="header-anchor" href="#导入项目" aria-hidden="true">#</a> 导入项目</h2><p>首先拿到项目地址：</p><p>使用svn拉到本地目录位置（自定义）</p>',16),l=a("br",null,null,-1),h={href:"https://blog.csdn.net/weixin_43435032/article/details/127067473?spm=1001.2014.3001.5506",target:"_blank",rel:"noopener noreferrer"},b=r(`<p>在idea中找到File --&gt; New --&gt; Project from Existing Sources，选择你需要导入的项目。</p><blockquote><p>因为这里是eclipse项目</p></blockquote><p>导入项目后会弹出 Import Project 界面：<br> 选择 Import project from external model (默认选项)，然后选择选项 Eclipse ，<br> 点击下一步（Next），默认配置，点击下一步，后会进行扫描，等待一下即可。<br> 然后勾选对应的项目，点击下一步，点到最后，选择JDK版本，这里选择JDK1.8，<br> 最后点击创建（Create），项目导入完成。</p><h2 id="配置项目" tabindex="-1"><a class="header-anchor" href="#配置项目" aria-hidden="true">#</a> 配置项目</h2><p>打开导入的项目后：</p><p>在idea中，找到 File --&gt; Project Structure ，<br> 然后开始配置。</p><h3 id="第一步-确定project中jdk版本" tabindex="-1"><a class="header-anchor" href="#第一步-确定project中jdk版本" aria-hidden="true">#</a> 第一步：确定Project中jdk版本</h3><p>选择SDK对应的JDK1.8</p><h3 id="第二步-modules-模块" tabindex="-1"><a class="header-anchor" href="#第二步-modules-模块" aria-hidden="true">#</a> 第二步：Modules (模块)</h3><p>点击左上方 + （加号），找到 Web 点击加入。<br> 然后点击项目名称，找到 Dependencies后，点击下面的 + （加号），<br> 点击 Library 添加对应的 Tomcat 。</p><h3 id="第三步-libraries" tabindex="-1"><a class="header-anchor" href="#第三步-libraries" aria-hidden="true">#</a> 第三步：Libraries</h3><p>点击 Libraries，点击左上方 + （加号），点击Java，然后找到项目对应的依赖路径位置 lib，<br> 点击添加 lib 即可</p><blockquote><p>一般lib位置在WEB-INF目录下</p></blockquote><h3 id="第四步-facets" tabindex="-1"><a class="header-anchor" href="#第四步-facets" aria-hidden="true">#</a> 第四步：Facets</h3><p>点击 Facets，点击左上方 + （加号），找到 Web 点击添加项目对应的模块</p><blockquote><p><strong>重点来了</strong></p></blockquote><p>点击 样式类似于 Web（项目名）的位置后，<br> 定位到Deployment Descriptors位置下方：<br> 点击 type下方的 Web Module Deployment Descriptor 之后，点击编辑（Edit），选择项目中对应的web.xml文件。</p><blockquote><p>这里注意了，一般项目中 是 web --&gt; WEB-INF --&gt; web.xml文件，<br> 但是 这个项目的web存放路径也可以自定义，比如 名称叫 interfacePlatform ，下面存放WEB-INF --&gt; web.xml文件，存放静态资源，存放对应的jar包。</p></blockquote><p>定位到 Web Resource Directories 位置：<br> 点击下方的路径，然后点击编辑按钮，修改静态资源存放路径的主目录，例如项目存放静态资源的主目录名为 interfacePlatform，</p><h3 id="第五步-artifacts" tabindex="-1"><a class="header-anchor" href="#第五步-artifacts" aria-hidden="true">#</a> 第五步：Artifacts</h3><p>点击 Artifacts，点击左上方 + （加号），找到 Web Application：Exlpoded --&gt; From Modules</p><p>选择项目中对应的模块，点OK即可。</p><p>第六步：找到 Platform Settings 位置<br> 点击 Problems ，如果有提示 fixed，就点击修复一下</p><p>最后，点击右下角的 Apply（应用），点 OK，这里就配置完成了。</p><h2 id="配置tomcat" tabindex="-1"><a class="header-anchor" href="#配置tomcat" aria-hidden="true">#</a> 配置tomcat</h2><p>在idea中找到 File --&gt; Settings --&gt; Build Execution，Deployment，<br> 然后找到 Application Servers并点击之后，<br> 点击左上方 + （加号），找到 Tomcat Server，<br> 添加Tomcat Home目录位置，然后下方的 Tomcat base directory就自动加上路径，点击OK就可以了，最后点击Apply（应用）和 OK</p><p>点击右上角的“Add configuration”，点击左上方 + （加号），找到 Tomcat Server --&gt; Local<br> 点击local后，点击 Tomcat 8.5.23 ，在右边找到Deployment，在下方 Deploy at the server startup，这一步默认可以省掉，原因是在上面 第五步：Artifacts 就已经配置好了。</p><p>如果你想请求路径不带有项目名，你就在 Application context下方，去掉项目名称直接留下 / (斜杠)即可。</p><p>最后就点击 Apply（应用）和 OK 。</p><p>最最后就可以稳定启动项目了。</p><h2 id="启动项目" tabindex="-1"><a class="header-anchor" href="#启动项目" aria-hidden="true">#</a> 启动项目</h2><p>可能遇到问题，tomcat端口占用，修改端口即可</p><p>项目中依赖问题，缺少依赖就添加对应的jar包，如果是测试类中缺少依赖就注释掉对应的代码。</p><p>有时候还是有问题，就需要rebuild --&gt; Rebuild Project (重新构建项目)</p><h2 id="遇到的问题" tabindex="-1"><a class="header-anchor" href="#遇到的问题" aria-hidden="true">#</a> 遇到的问题</h2><h3 id="问题一-svn使用问题" tabindex="-1"><a class="header-anchor" href="#问题一-svn使用问题" aria-hidden="true">#</a> 问题一：svn使用问题</h3><p>如果你使用的svn是TortoiseSVN-1.8.8.25755-x64-svn-1.8.10.msi版本时，你在idea的设置中，找到version Control（版本控制），找到Subversion，找到 Path to Subversion executable 配置svn启动exe。<br> 但是在TortoiseSVN-1.8.8.25755-x64-svn-1.8.10.msi 版本对应的安装目录下，貌似没有svn.exe文件。<br> idea就会提示找到svn对应的.exe</p><p>使用TortoiseSVN-1.8.8.25755-x64-svn-1.8.10.msi时idea提示报错：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>Cant&#39;s use Subversion command line client D:\\ProgramFiles\\TortoiseSVN\\bin\\svn.exe
The path to the Subversion excutable is probably wrong
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div></div></div><p>解决方法：<br> 我是直接换一个svn版本：TortoiseSVN-1.14.5.29465-x64-svn-1.14.2.msi<br> 这个安装时也会提示报错，说缺少windows Server 2008 R2 Enterprise缺少组件，于是找到对应的组件包（vc_redist.x64.exe）安装即可解决问题。</p><h2 id="问题二" tabindex="-1"><a class="header-anchor" href="#问题二" aria-hidden="true">#</a> 问题二</h2><p>idea中可能报错：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>java：常量字符串过长
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><p>原因是：将eclipse项目导入到idea中，会遇到这样的问题。</p><p>解决方法：<br> 在idea设置中找到Build，Execution，Deploymentw位置，点击Compiler，点击Java Compiler，找到Use comiler，然后选择eclipse，点击Apply（应用），点OK即可。</p><blockquote><p>注意：在没有出现这样的问题的情况下，还是使用Javac，每个项目的使用情况可能不同。<br> 还有，如果之前改为了eclipse，后面换了一个项目，建议及时改回Javac，然后后面编译总是报错，也找到问题所在，那就很难受了。</p><p>不过呢，对于现在SpringBoot项目一般不会出现这样的问题。</p></blockquote>`,46);function u(m,x){const t=o("ExternalLinkIcon");return s(),n("div",null,[c,a("p",null,[e("项目本身是eclipse编写的，由此你需要会如何将eclipse项目导入到idea中："),l,e(" 教程可以参考这："),a("a",h,[e("https://blog.csdn.net/weixin_43435032/article/details/127067473?spm=1001.2014.3001.5506"),d(t)])]),b])}const _=i(p,[["render",u],["__file","eclipse项目在idea中打开.html.vue"]]);export{_ as default};
